import { Container, Typography } from "@material-ui/core";
import React from "react";
import Sidebar from "./Sidebar";

const UserDashboard = () => {
	return (
		<div>
			<Container maxWidth="lg">
				<Typography variant="h2">USER DASHBOARD</Typography>
				<Sidebar />
			</Container>
		</div>
	);
};

export default UserDashboard;
